// src/pages/CliqueDistributionPage.js
import React from 'react';
import HistogramChart from '../components/HistogramChart';
import { firstDataset, secondDataset, thirdDataset } from '../data/datasets';

const CliqueDistributionPage = () => {
  return (
    <div style={{ padding: '1rem' }}>
      <h1>Clique Distribution Histograms</h1>
      
      <HistogramChart
        data={firstDataset}
        title="Clique Size Distribution (Dataset 1)"
        color="#4f81bd"
      />
      
      <HistogramChart
        data={secondDataset}
        title="Clique Size Distribution (Dataset 2)"
        color="#c0504d"
      />
      
      <HistogramChart
        data={thirdDataset}
        title="Clique Size Distribution (Dataset 3)"
        color="#9bbb59"
      />
    </div>
  );
};

export default CliqueDistributionPage;
